import './App.css';
import DataSummary from './components/DataSummary';

function App() {
  const showDataSummary=true;

  return (
    <div className="App">
      {showDataSummary ? (
        <div>
          <DataSummary name="caleb"/>
        <DataSummary name="finn"/>
        <DataSummary/>
        <DataSummary/>
        <DataSummary/>  
        </div>
    ) : (
      <p>You cannot see the DataSummaries</p>
    ) }
    </div>
  );
}

export default App;
